import React, { Component } from 'react';
import { Bills } from '../../Fetches/Queries';

class Reports extends Component {
  constructor() {
    super();
    this.fetchBill = this.fetchBill.bind();
  }
  fetchBill = async () => {
    let a = await Bills();
    await console.log(a);
  };
  componentDidMount() {
    this.fetchBill();
  }
  render() {
    return <div>Reports</div>;
  }
}

export default Reports;
